import React, { useState } from 'react'
// import img from "./image/b2.jpg"

const App = () => {
  const [data, setData] = useState("")
  const [move, setMove] = useState([])
const changeEvent =(e)=>{
  setData(e.target.value)
}
const adItem =()=>{
  setMove((preVal)=>{
    return[...preVal, data]
  })
}
  
  return (
    <>
   <h1>To DoList</h1>
   <input type="text" 
     placeholder="Add a items"
     onChange={changeEvent}
   />
   <button onClick={adItem}>+</button>
   <ol>
   <button>-</button>
     {
      move.map((crnVal)=>{
        <li>{crnVal}</li>
      })
     }
   </ol>
        
    </>
  )
}

export default App
